        ///     var a = Length.FromMeters(2.0);
        ///     var b = Length.FromInches(50.0);
        ///     a.Equals(b, 0.01, ComparisonType.Absolute);
        ///     </code>
        ///     </example>
        ///     </para>
        ///     <para>
        ///     Note that it is advised against specifying zero difference, due to the nature
        ///     of floating point operations and using System.Double internally.
        ///     </para>
        /// </summary>
        /// <param name="other">The other quantity to compare to.</param>
        /// <param name="tolerance">The absolute or relative tolerance value. Must be greater than or equal to 0.</param>
        /// <param name="comparisonType">The comparison type: either relative or absolute.</param>
        /// <returns>True if the absolute difference between the two values is not greater than the specified relative or absolute tolerance.</returns>
        public bool Equals(ElectricPotentialRate other, double tolerance, ComparisonType comparisonType)
        {
            if(tolerance < 0)
                throw new ArgumentOutOfRangeException("tolerance", "Tolerance must be greater than or equal to 0.");

            double thisValue = (double)this.Value;
            double otherValueInThisUnits = other.As(this.Unit);

            return UnitsNet.Comparison.Equals(thisValue, otherValueInThisUnits, tolerance, comparisonType);
        }

        /// <summary>
        ///     Returns the hash code for this instance.
        /// </summary>
        /// <returns>A hash code for the current ElectricPotentialRate.</returns>
        public override int GetHashCode()
        {
            return new { QuantityType, Value, Unit }.GetHashCode();
        }

        #endregion

        #region Conversion Methods

        double IQuantity.As(object unit) => As((ElectricPotentialRateUnit)unit);

        /// <summary>
        ///     Convert to the unit representation <paramref name="unit" />.
        /// </summary>
        /// <returns>Value converted to the specified unit.</returns>
        public double As(ElectricPotentialRateUnit unit)
        {
            if(Unit == unit)
                return Convert.ToDouble(Value);

            var converted = AsBaseNumericType(unit);
            return Convert.ToDouble(converted);
        }

        /// <summary>
        ///     Converts this ElectricPotentialRate to another ElectricPotentialRate with the unit representation <paramref name="unit" />.
        /// </summary>
        /// <returns>A ElectricPotentialRate with the specified unit.</returns>
        public ElectricPotentialRate ToUnit(ElectricPotentialRateUnit unit)
        {
            var convertedValue = AsBaseNumericType(unit);
            return new ElectricPotentialRate(convertedValue, unit);
        }

        /// <summary>
        ///     Converts the current value + unit to the base unit.
        ///     This is typically the first step in converting from one unit to another.
        /// </summary>
        /// <returns>The value in the base unit representation.</returns>
        private double AsBaseUnit()
        {
            switch(Unit)
            {
                case ElectricPotentialRateUnit.KilovoltPerHour: return (_value/3600) * 1e3d;
                case ElectricPotentialRateUnit.KilovoltPerMinute: return (_value/60) * 1e3d;
                case ElectricPotentialRateUnit.KilovoltPerSecond: return (_value) * 1e3d;
                case ElectricPotentialRateUnit.MegavoltPerHour: return (_value/3600) * 1e6d;
                case ElectricPotentialRateUnit.MegavoltPerMinute: return (_value/60) * 1e6d;
                case ElectricPotentialRateUnit.MegavoltPerSecond: return (_value) * 1e6d;
                case ElectricPotentialRateUnit.MicrovoltPerHour: return (_value/3600) * 1e-6d;
                case ElectricPotentialRateUnit.MicrovoltPerMinute: return (_value/60) * 1e-6d;
                case ElectricPotentialRateUnit.MicrovoltPerSecond: return (_value) * 1e-6d;
                case ElectricPotentialRateUnit.MillivoltPerHour: return (_value/3600) * 1e-3d;
                case ElectricPotentialRateUnit.MillivoltPerMinute: return (_value/60) * 1e-3d;
                case ElectricPotentialRateUnit.MillivoltPerSecond: return (_value) * 1e-3d;
                case ElectricPotentialRateUnit.VoltPerHour: return _value/3600;
                case ElectricPotentialRateUnit.VoltPerMinute: return _value/60;
                case ElectricPotentialRateUnit.VoltPerSecond: return _value;
                default:
                    throw new NotImplementedException($"Can not convert {Unit} to base units.");
            }
        }

        private double AsBaseNumericType(ElectricPotentialRateUnit unit)
        {
            if(Unit == unit)
                return _value;

            var baseUnitValue = AsBaseUnit();

            switch(unit)
            {
                case ElectricPotentialRateUnit.KilovoltPerHour: return (baseUnitValue*3600) / 1e3d;
                case ElectricPotentialRateUnit.KilovoltPerMinute: return (baseUnitValue*60) / 1e3d;
                case ElectricPotentialRateUnit.KilovoltPerSecond: return (baseUnitValue) / 1e3d;
                case ElectricPotentialRateUnit.MegavoltPerHour: return (baseUnitValue*3600) / 1e6d;
                case ElectricPotentialRateUnit.MegavoltPerMinute: return (baseUnitValue*60) / 1e6d;
                case ElectricPotentialRateUnit.MegavoltPerSecond: return (baseUnitValue) / 1e6d;
                case ElectricPotentialRateUnit.MicrovoltPerHour: return (baseUnitValue*3600) / 1e-6d;
                case ElectricPotentialRateUnit.MicrovoltPerMinute: return (baseUnitValue*60) / 1e-6d;
                case ElectricPotentialRateUnit.MicrovoltPerSecond: return (baseUnitValue) / 1e-6d;
                case ElectricPotentialRateUnit.MillivoltPerHour: return (baseUnitValue*3600) / 1e-3d;
                case ElectricPotentialRateUnit.MillivoltPerMinute: return (baseUnitValue*60) / 1e-3d;
                case ElectricPotentialRateUnit.MillivoltPerSecond: return (baseUnitValue) / 1e-3d;
                case ElectricPotentialRateUnit.VoltPerHour: return baseUnitValue*3600;
                case ElectricPotentialRateUnit.VoltPerMinute: return baseUnitValue*60;
                case ElectricPotentialRateUnit.VoltPerSecond: return baseUnitValue;
                default:
                    throw new NotImplementedException($"Can not convert {Unit} to {unit}.");
            }
        }

        #endregion

        #region ToString Methods

        /// <summary>
        ///     Get default string representation of value and unit.
        /// </summary>
        /// <returns>String representation.</returns>
        public override string ToString()
        {
            return ToString(null);
        }

        /// <summary>
        ///     Get string representation of value and unit. Using two significant digits after radix.
        /// </summary>
        /// <returns>String representation.</returns>
        /// <param name="cultureName">Name of culture (ex: "en-US") to use for localization and number formatting. Defaults to <see cref="GlobalConfiguration.DefaultCulture" /> if null.</param>
        public string ToString([CanBeNull] string cultureName)
        {
            var provider = cultureName;
            return ToString(provider, 2);
        }

        /// <summary>
        ///     Get string representation of value and unit.
        /// </summary>
        /// <param name="significantDigitsAfterRadix">The number of significant digits after the radix point.</param>
        /// <returns>String representation.</returns>
        /// <param name="cultureName">Name of culture (ex: "en-US") to use for localization and number formatting. Defaults to <see cref="GlobalConfiguration.DefaultCulture" /> if null.</param>
        public string ToString(string cultureName, int significantDigitsAfterRadix)
        {
            var provider = cultureName;
            var value = Convert.ToDouble(Value);
            var format = UnitFormatter.GetFormat(value, significantDigitsAfterRadix);
            return ToString(provider, format);
        }

        /// <summary>
        ///     Get string representation of value and unit.
        /// </summary>
        /// <param name="format">String format to use. Default:  "{0:0.##} {1} for value and unit abbreviation respectively."</param>
        /// <param name="args">Arguments for string format. Value and unit are implicitly included as arguments 0 and 1.</param>
        /// <returns>String representation.</returns>
        /// <param name="cultureName">Name of culture (ex: "en-US") to use for localization and number formatting. Defaults to <see cref="GlobalConfiguration.DefaultCulture" /> if null.</param>
        public string ToString([CanBeNull] string cultureName, [NotNull] string format, [NotNull] params object[] args)
        {
            var provider = GetFormatProviderFromCultureName(cultureName);
            if (format == null) throw new ArgumentNullException(nameof(format));
            if (args == null) throw new ArgumentNullException(nameof(args));

            provider = provider ?? GlobalConfiguration.DefaultCulture;

            var value = Convert.ToDouble(Value);
            var formatArgs = UnitFormatter.GetFormatArgs(Unit, value, provider, args);
            return string.Format(provider, format, formatArgs);
        }

        #endregion

        private static IFormatProvider GetFormatProviderFromCultureName([CanBeNull] string cultureName)
        {
            return cultureName != null ? new CultureInfo(cultureName) : (IFormatProvider)null;
        }
    }
